import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; // Import your CSS file

function Header() {
  return (
    <div className="header">
      <div className="logo">Tech Space</div>
      import githubLogo from '/Users/adrianburke/Desktop/Full-StackProject-FrontEnd-/src/Tech_Space-removebg-preview.png';
      <img
          className="github-logo"
          src={githubLogo} // Use the imported image as the source
          alt="GitHub Logo"
        />
      <div className="title"></div>
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="/profile">Profile</Link>
        <Link to="/login">Log In</Link> {/* Add the Login link */}
        {/* Add other navigation links */}
      </div>
      <div className="page-content"></div>
    </div>
  );
}

export default Header;
